void add(int x,int y,LL z){
	G[++tot].to=y;G[tot].next=h[x];h[x]=tot;G[tot].w=z;
}

bool bfs(){
	for (int i=0;i<=n;++i) vis[i]=-1;
	queue<int>q; q.push(S); vis[S]=0;
	while (!q.empty()){
		int u=q.front(); q.pop();
