}

int dfs(int x,LL f){
	if (x==T||f==0) return f;
	LL w,used=0;
	for (int i=cur[x];i;i=G[i].next)
	    if (vis[G[i].to]==vis[x]+1){
			w=f-used;
			w=dfs(G[i].to,min(w,G[i].w));
			G[i].w-=w; G[i^1].w+=w;
			used+=w; if (G[i].w) cur[x]=i;
			if (used==f) return used;
	    }
	if (!used) vis[x]=-1;
	return used;
}

void dfs_f(int x){
